import closePopupButtonImage from '../images/button__cross.svg'


function ImagePopup(props) {

  return (
    <div className={`popup popup_type_image ${props.card ? 'popup_is-opened' : ''}`}>
        <div className="popup__container popup__container_type_image">
            <img src={props.card.image} alt="Фотография" className="popup__image" />
            <h2 className="popup__header popup__header_place_image">{props.card.title}</h2>
            <button className="popup__close popup__close_place_image item-animation"><img src="<%=require('./images/button__cross.svg')%>"
                    alt="закрыть" className="popup__close-cross" onClick={props.onClose} />
            </button>
        </div>
    </div>
  );
}

export default ImagePopup;
